import React from "react";
import Messages from "./Messages";
import Input from "./Input";

function Chat() {
  return (
    <div className="chat">
      <div className="chatinfo">
        <span>dogesh </span>
        <div className="chatIcons"></div>
      </div>
      <Messages/>
      <Input/>
    </div>
  );
}

export default Chat;
